import React from 'react'
import './css/Banner.css'

const Banner = () => {
  return (
    <div class="banner">
        <div class="banner-img-left">
            
        </div>
        <div class="banner-text">
            <h1>Insure</h1>
        </div>
    </div>
  );
}

export default Banner;
